  height: 2.5em;
  width: 15em;
  text-align: center;
  border-radius: 15px;
  border: 0.05rem solid colors.$black;
  box-shadow: 0px 0.35em 6px rgba(0, 0, 0, 0.65);
  &:hover {
    cursor: pointer;
    color: colors.$white;
  }
}

